MUTATIONS[3378] = `mutation mutation3378 { createUserMeta(data: {oldId:"17308",user:{connect:{oldId:"771"}},metaType:"",metaName:"userBio",metaValue:"When%20I%20go%20to%20an%20exhibition%2C%20hear%20some%20great%20music%2C%20or%20read%20a%20good%20book%20I%20want%20to%20know%20more%20about%20who%20made%20it.%20The%20pictures%20make%20more%20sense%20when%20you%20can%20slot%20them%20into%20the%20frame%20of%20the%20creator%u2019s%20life.%0D%0A%0D%0AMy%20relationship%20with%20music%20started%20when%20I%20was%20five%20but%20it%20wasn%u2019t%20until%20my%20early%20twenties%20that%20I%20had%20the%20guts%20to%20pursue%20it%20seriously.%20I%20sang%2C%20played%20piano%20and%20other%20instruments%20performed%20in%20school%20plays%20and%20musicals%20but%20essentially%20used%20to%20music%20to%20escape%20from%20the%20drudgery%20of%20homework%2C%20lessons%20and%20life%20and%20hid%20myself%20away%20in%20the%20practice%20rooms.%20This%20all%20came%20to%20an%20abrupt%20end%20when%20I%20fell%20%28I%20say%20fell%20because%20the%20disease%20is%20insidious%29%20into%20Anorexia.%20I%20gave%20up%20everything%20for%20about%205%20years.%20Sport%2C%20music%2C%20friends%2C%20life%20and%20spent%20my%20days%20counting%20calories.%20Looking%20back%2C%20I%20learnt%20a%20lot%20but%20it%20was%20in%20essence%20wasted%20time.%20It%20also%20meant%20that%20whilst%20at%20university%20in%20Manchester%20when%20I%20should%20have%20been%20starting%20my%20first%20band%2C%20I%20spent%20my%20time%20on%20activities%20designed%20to%20rub%20out%20my%20existence.%20With%20the%20help%20of%20family%20and%20friends%2C%20I%20slowly%20crawled%20out%20of%20the%20pit%20and%20bumped%20back%20into%20music%20on%20my%20way%20out.%20%0D%0AMusic%20gave%20me%20back%20who%20I%20was.%20I%20started%20learning%20the%20guitar%20when%20I%20moved%20to%20Italy%20and%20the%20unfamiliarity%20of%20a%20new%20instrument%20led%20me%20back%20into%20writing%20songs.%20I%20started%20my%20first%20band%21%20It%20was%20terrible%2C%20I%20started%20another%20band%20and%20we%20did%20quite%20well-%20supporting%20Bryan%20Ferry%20at%20the%20Natural%20History%20Museum%2C%20releasing%20our%20first%20EP%2C%20a%20few%20TV%20and%20radio%20appearances%20and%20tours%20in%20Italy%20and%20the%20UK.%20As%20a%20solo%20artist%20during%20that%20time%20I%20worked%20with%20Franco%20Battiato%20and%20the%20late%20Lucio%20Dalla%20and%20collaborated%20with%20the%20Piccolo%20Coro%2C%20a%20well-known%20Italian%20children%u2019s%20choir.%20I%20liked%20being%20in%20a%20band%20so%20it%20was%20difficult%20to%20leave%20to%20pursue%20a%20different%20musical%20idea.%20I%20was%20scared%20of%20being%20on%20my%20own%20and%20insecure%20about%20my%20abilities.%20I%20fell%20into%20a%20black%20hole%20-%20insomnia%20and%20all%20the%20rest%20of%20it.%20It%20was%20through%20the%20writing%20of%20the%20album%20%u201CThe%20Widowed%20Earth%u201D%20that%20everything%20started%20to%20make%20sense.%20I%20wanted%20to%20make%20something%20beautiful%20that%20celebrated%20the%20essence%20of%20what%20it%20means%20to%20be%20human.%20I%20couldn%u2019t%20keep%20myself%20out%20of%20the%20story%20but%20but%20came%20to%20realise%20how%20connected%20we%20are%20to%20our%20natural%20surroundings%20and%20how%20they%20can%0D%0Aliterally%20%26quot%3Bheal%20you%26quot%3B.%20The%20result%20is%20an%20album%20that%20I%20am%20very%20proud%20of%0D%0Aand%20love.%20I%20hope%20that%20it%20will%20resonate%20with%20others%20and%20am%20really%20looking%20forward%20to%20taking%20it%20live%20-%20I%20want%20to%20give%20people%20a%20magical%20experience.%0D%0A%0D%0ADos%20Floris%20is%20a%20multi-%20instrumentalist%20who%20lives%20in%20Bologna%20Italy.%20Her%20debut%20album%20The%20Widowed%20Earth%20is%20due%20for%20release%20on%20the%205th%20November%202015.%20Silence%20the%20first%20single%20from%20the%20album%20is%20out%20now.%0D%0A%0D%0A%0D%0A",metaDeleted:false}) { id } } `
    
